// App.js
import React from 'react';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import {Main} from './views/pages/Main'; 
import {CarPage} from './views/pages/Car'; 

const App = () => {
    return (
        <BrowserRouter>
            <Routes>
            <Route path="/" element={<Main />} />
                {/* <Route path="/car" element={<CarPage />} /> */}
            </Routes>
        </BrowserRouter>
    );
}

export default App;
